(function() {

	var classModule = document.querySelector('body').className;

    if (classModule !== 'homepage') {
        
        var listOfLi     = document.querySelectorAll('.navbar-nav a');
        var url          = window.location.href.split("/", 3).join("/");
        var sectionTitle = document.querySelector('.section-title');

        Array.prototype.forEach.call(listOfLi, function (li) {

            var href = li.href.split("#")[1];
            li.href    = url + '/#' + href;
            li.parentNode.classList.remove('active');
        
            if(sectionTitle != null && sectionTitle.innerText == li.innerText.toUpperCase()){

                li.parentNode.classList.add('active');
            }

            return;
        });

    }

})();

